import React from "react";

export default function Textform(props) {
  return (
    <div>
      <h1>{props.heading}</h1>
      <div class="mb-3">
        <label for="MyTExt" class="form-label">
          Example textarea
        </label>
        <textarea
          class="form-control"
          id="exampleFormControlTextarea1"
          rows="3"
        ></textarea>
      </div>
    </div>
  );
}
